/**
 * 注册界面
 * @file signup.js
 * @author 
 * @copyright 
 * @createDate 2020-12-15
 */

import React from 'react'
import "../signup/signup.css"
import { Link } from 'react-router-dom'
import axios from 'axios'
let base = "/api";
const teaminfo_model = {
    code:0,
    name: "666",
    list: { seed: "", score: "", last_score: "" },
    rank_score: "",
    match_ranks: [],
    finals_score: "",
    team_docker: { port: 0}
}
//1为登录 0为未登录
let info_model = {
    old: "",
    new: "",
    new_c:"",
}

const haslogin_model = 0;
let filedata = new FormData();
const user={
    seedCode:"",
    fileName:"",
    rank:[],
    Aalert:{title:"标题",txt:"我是文本"},
    matches:[],
    finals_rank:[],
    seed_list:[],
    info:info_model,
    teaminfo:teaminfo_model,
    haslogin: haslogin_model,
async created(){
    user.hassignin();
    user.getseed();
    user.getmatch();
    user.getrank();
    user.getstage();
}
}
//拦截
axios.interceptors.response.use(
    data => {
      return data;
    },
    err => {
      if (err.response.status === 504 || err.response.status === 404) {
        console.log("服务器被吃了⊙﹏⊙∥");
      } else if (err.response.status === 401) {
        console.log("登录信息失效⊙﹏⊙∥");
      } else if (err.response.status === 500) {
        console.log("服务器开小差了⊙﹏⊙∥");
      }
      return Promise.reject(err);
    }
  );
  //get
  function get(){
    //axios.get('http://localhost:3000/post?id=1')
    axios({
        url:'/posts',
        param:{
            id:1
        }
    })
    .then(response => {
        console.log('/posts get',response.data)
    })
    .catch(error => {
        console.log('error',error.message)
    })
}
 //post
function post(){
   // axios.post('http://localhost:3000/post',{"title":"json-server3"})
    axios({
        url:'/post',
        methods:'post',
        data:{"title":"json-server3"}
          
    })
    .then(response => {
        console.log('/posts post',response.data)
    })
}
//paste
async function reset(){
    if(user.info.new==user.info.new_c&&this.info.old!=""&&this.info.new!=""){
        let data = await this.Apost('/upload_submit_txt/', this.info);
            if (data.code == 111) {
                this.x_alert("原密码错误");
            } else if (data.code == 107) {
                this.x_alert("未登录");
            } else if (data.code == 0) {
                window.location.href = "signin.html";
            }
            }else
                this.x_alert("两次输入的密码不一致");
            return;
}
