    file=event.target.files[0];
    filedata.append('file',file);
    this.fileName=file.name;
},*/

async function submit(){
    if (filedata == new FormData()||this.seedcode=="") {
        this.x_alert("数据有误");
    }
    filedata.append('seed', this.seedcode);
    let formdata= await this.Apost('/upload_submit_txt/',filedata);
    {
        if (formdata.code == 114) {
                this.x_alert("今日提交次数已到上限");
                window.location.reload();
            } else if (formdata.code == 107) {
                this.x_alert("请先登陆");
                window.location.reload();
            } else if (formdata.code == 108) {
                this.x_alert("您的队伍未晋级");
                window.location.reload();
            } else if (formdata.code == 115) {
                this.x_alert("提交文件超过10M");
                window.location.reload();
            } else if (formdata.code == 116) {
                this.x_alert("请提交标准格式的zip压缩包");
                window.location.reload();
            } else if (formdata.code == 0) {
                this.x_alert("上传成功(´・ω・`)");
                window.location.reload();
            } else if (formdata.code == 100) {
                this.x_alert("评分失败，请检查输出文件的格式");
                window.location.reload();
            } else if (formdata.code == 117) {
                this.x_alert("文件内容不正确");
                window.location.reload();
            } else if (formdata.code == 119) {
                this.x_alert("当前不可以提交");
                window.location.reload();
            }
        }

}
